import { useState } from "react";
import * as Icons from "lucide-react";

const GENDER_OPTIONS = [
  { label: "Male", value: "male" },
  { label: "Female", value: "female" },
  { label: "Both", value: "both" },
  { label: "Custom", value: "custom" },
];
const FORMAT_OPTIONS = [
  "1x1", "2x2", "3x3", "5x5", "10x10"
];

export default function StepSportDetails({ sports, onChange, onNext }) {
  const [details, setDetails] = useState(
    sports.map(s => ({
      ...s,
      gender: "male",
      age_group: "",
      weight_class: "",
      format: "5x5",
      team_limit: 8,
    }))
  );

  // Update details when any field changes
  const handleChange = (idx, field, value) => {
    const newDetails = details.map((item, i) =>
      i === idx ? { ...item, [field]: value } : item
    );
    setDetails(newDetails);
    onChange(newDetails);
  };

  return (
    <div>
      <h2 className="text-xl font-bold mb-4 text-athletiq-navy">Configure Sports Details</h2>
      <div className="flex flex-col gap-6">
        {details.map((item, idx) => {
          const Icon = Icons[item.icon] || Icons.Trophy;
          return (
            <div key={item.key} className="flex gap-6 items-center bg-white rounded-2xl shadow p-4 border border-athletiq-blue/20">
              <div className="flex flex-col items-center justify-center w-24">
                <Icon className="w-10 h-10 text-athletiq-blue mb-2" />
                <span className="text-xs font-semibold text-athletiq-navy">{item.name}</span>
              </div>
              <div className="flex flex-wrap gap-4 flex-1">
                {/* Gender */}
                <div>
                  <label className="font-semibold block mb-1">Category</label>
                  <select
                    className="border p-2 rounded w-32"
                    value={item.gender}
                    onChange={e => handleChange(idx, "gender", e.target.value)}
                  >
                    {GENDER_OPTIONS.map(opt => (
                      <option key={opt.value} value={opt.value}>{opt.label}</option>
                    ))}
                  </select>
                </div>
                {/* Age group */}
                <div>
                  <label className="font-semibold block mb-1">Age Group</label>
                  <input
                    className="border p-2 rounded w-28"
                    placeholder="e.g. U-15"
                    value={item.age_group}
                    onChange={e => handleChange(idx, "age_group", e.target.value)}
                  />
                </div>
                {/* Weight class */}
                <div>
                  <label className="font-semibold block mb-1">Weight (if any)</label>
                  <input
                    className="border p-2 rounded w-28"
                    placeholder="e.g. 48-52kg"
                    value={item.weight_class}
                    onChange={e => handleChange(idx, "weight_class", e.target.value)}
                  />
                </div>
                {/* Format */}
                <div>
                  <label className="font-semibold block mb-1">Format</label>
                  <select
                    className="border p-2 rounded w-24"
                    value={item.format}
                    onChange={e => handleChange(idx, "format", e.target.value)}
                  >
                    {FORMAT_OPTIONS.map(opt => (
                      <option key={opt} value={opt}>{opt}</option>
                    ))}
                  </select>
                </div>
                {/* Team/Participant limit */}
                <div>
                  <label className="font-semibold block mb-1">Teams/Players</label>
                  <input
                    className="border p-2 rounded w-16"
                    type="number"
                    min="2"
                    value={item.team_limit}
                    onChange={e => handleChange(idx, "team_limit", e.target.value)}
                  />
                </div>
              </div>
            </div>
          );
        })}
      </div>
      <div className="flex justify-end mt-8">
        <button
          className="px-5 py-2 rounded bg-athletiq-green text-white font-semibold"
          onClick={onNext}
        >
          Next
        </button>
      </div>
    </div>
  );
}
